const BASE_URL = "http://localhost:8989";

const headers = {
    "Accept": "application/json",
    "Content-Type": "application/json"
}

export const login = async (email, password) => {
    const req = await fetch(`${BASE_URL}/signin`, {
        method: "POST",
        headers,
        body: {
            email,
            password
        }
    });

    console.log(req)

    const res = await req.json();

    return res;
}
